import axios from "axios";
import { useState } from "react";

const DeleteWilder = (wilderId) => {
    const[key, setKey] = useState("")
    return (
        <form 
        onSubmit={(e) => {
            e.preventDefault();
            axios.delete("http://localhost:5000/api/wilder/");
          }}
        >
        <button>Delete</button>
        </form>
    );
};

export default DeleteWilder;
